pragma solidity 0.5.1;



contract Owned {
    address payable owner;
    constructor() public { 
      owner = msg.sender; 
    }
    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }
    function getOwner() public view returns(address payable){
        return owner;
    } 
}

contract Tradeable is Owned {
    constructor() public {}

    function trade(address payable to) onlyOwner public{
        owner = to;
    }
}

contract Purchasable is Owned{
    uint64 price;
    bool canPurchase;

    constructor() public {
        canPurchase = false;
    }

    function setPrice(uint64 _price) onlyOwner public {
        price = _price;
    }

    function isPurchasable() public view returns (bool) {
        return canPurchase;
    }

    function setPurchasable(bool _canPurchase) onlyOwner public {
        canPurchase = _canPurchase;
    }

    function() external {}

    function getPrice() public view returns (uint64){
        return price;
    }

    function buy() payable public returns (bool){
        if (!canPurchase) {
            return false;
        }
        require(msg.value >= price);
        canPurchase = false;
        owner = msg.sender;
        return true;
    }

}
contract Chargable is Owned{

    constructor() public{        
    }

    modifier price(uint _cost) {
        require(msg.value >= _cost);
        _;
        owner.transfer(msg.value);
    }
}


contract NameRegistry is Owned {

    mapping (address=>string) names;
    mapping (string=>address) addresses;
    event add(address);

    constructor(address payable _owner) public {
        owner = _owner;
    }

    function addName(string memory _name, address _address) onlyOwner public returns (bool) 
    {
        if (addresses[_name] != address(0))
            return false;

        names[_address] = _name;
        addresses[_name] = _address;
        emit add(_address);
        return true;
    }

    function getName(address _address) public view returns (string memory)
    {
        return names[_address];
    }

    function getAddress(string memory _name) public view returns (address)
    {
        return addresses[_name];
    }
}

contract PlayerRegistry is Owned {

    //map from accounts to player contracts
    mapping (address=>Player) players;

    constructor(address payable _owner) public {
        owner = _owner;
    }
    function() external payable{}

    function newPlayer(uint8[] memory statArray) public returns(bool){

        //not sure total
        uint8 max = 72;
        uint8 total = 0;
        for (uint256 i=0; i< 6; i++){
            if (statArray[i] > 16 || statArray[i] < 9)
                return false;

            total += statArray[i];
        }
        if (total > max)
            return false;

        players[msg.sender] = new Player(statArray, msg.sender);
        return true;
    }

    function getPlayerByAddress(address _player) public view returns (Player) {
        return players[_player];
    }

}

interface GameComponent {
    function getStats() external view returns (uint8[8] memory);
    function getOwner() external view returns (address payable);
}

