//TODO use maps, always use maps, arrays are terrible
contract Player is Owned{
    uint8[] stats;
    GameComponent[] items;

    constructor(uint8[] memory _stats, address payable _owner) public {
        owner = _owner;
        stats = _stats;
    }

    function getItems() public view returns (GameComponent[] memory) {
        return items;
    }

    function addItem(NameRegistry _itemRegistry, string memory _item) onlyOwner public returns (uint8){

        address item = _itemRegistry.getAddress(_item);
        bool addedAddress = false;
        if (item == address(0))
            return 1;

        Item i = Item(item); 
        if (i.getOwner() != owner)
            return 2;

        uint16 len = uint16(items.length);
        for (uint16 l = 0; l < len; l++) {
            if (items[l].getOwner() != owner) {
                if (addedAddress)
                    delete items[l];
                else {
                    items[l] = i;
                    addedAddress = true;
                } 
            }
            if (i == items[l])
                return 3;
         }

        if (addedAddress)
           return 0;

        items.push(i);

        return 0;
    }

    function getStats() public view returns (uint8[] memory){
        return stats;
    }

}

contract Item is GameComponent, Purchasable, Tradeable {

    uint8[8] stats;
    constructor(uint8[8] memory _stats) public {
        stats = _stats;
    }

    function getStats() external view returns (uint8[8] memory){
        return stats;
    } 
}


contract Game is Owned {

    PlayerRegistry playerRegistries;
    NameRegistry itemRegistries;

    constructor() public {
        itemRegistries = new NameRegistry(msg.sender);
        playerRegistries = new PlayerRegistry(msg.sender);
    }

    function getPlayerRegistry() public view returns (PlayerRegistry){
        return playerRegistries;
    }

    function getItemRegistry() public view returns (NameRegistry) {
        return itemRegistries;
    }
}
